import React, { Component } from "react";
import Card from './Card-impact';
import Header from '../../Accueil';
import './Impact.css';

class Impact extends Component {
  render() {
    return (
      <div>
         <Header />
            <MDBContainer fluid>
              <Card />
            </MDBContainer>
      </div>
    );
  }
  };

  export default Impact;
